app.controller('menuController', function($scope, $ionicPopup, $rootScope, $cordovaGeolocation, $cordovaCamera, $location, $state) {
	

  var usuario = JSON.parse(localStorage.getItem("usuario"));
  document.getElementById('nomeMenu').innerHTML = usuario.nome;
  document.getElementById('sobrenomeMenu').innerHTML = usuario.sobrenome;
  document.getElementById('cidadeMenu').innerHTML = usuario.cidade;
  document.getElementById('estadoMenu').innerHTML = usuario.estado;
  

  var options = {timeout: 10000, enableHighAccuracy: true, EnableContinuousZoom: true};

  $cordovaGeolocation.getCurrentPosition(options).then(function(position){

        var posicaoAtual = new google.maps.LatLng(position.coords.latitude, position.coords.longitude);
        getAddress();
        function getAddress(){

           // This is making the Geocode request
           var geocoder = new google.maps.Geocoder();

           geocoder.geocode({ 'latLng': posicaoAtual }, function (results, status) {
           // This is checking to see if the Geoeode Status is OK before proceeding
           if (status == google.maps.GeocoderStatus.OK) {

               enderecoCompleto = results[0].formatted_address;
               $scope.cidadeAtual = results[0].address_components[4].long_name;
               $scope.estadoAtual = results[0].address_components[5].long_name;
               console.log($scope.estadoAtual);
               
               
              
           }
          });
        }
      });

  


  $scope.changeView = function(local){
    $state.go(local);

  }


  $scope.inserirPostagem = function(){
      var confirmPopup = $ionicPopup.confirm({
                            title: 'Nova Postagem',
                            template: 'Deseja fazer uma postagem?'
                         });

          confirmPopup.then(function(res) {
            if(res == true) {
              takePicture();
            }
          });
  };
    
  function takePicture(){
    if(typeof(Camera) != "undefined"){
        var options = {
          quality: 100,
          destinationType: Camera.DestinationType.DATA_URL,
          sourceType: Camera.PictureSourceType.CAMERA,
          allowEdit: true,
          encodingType: Camera.EncodingType.JPEG,
          targetWidth: 700,
          targetHeight: 480,
          popoverOptions: CameraPopoverOptions,
          saveToPhotoAlbum: false,
          correctOrientation:true
        };

        $cordovaCamera.getPicture(options).then(function(imageData) {
            $rootScope.foto = "data:image/jpeg;base64," + imageData;
            $state.go("app.postar");
        }, function(err) {
          // error
        });
    } else {
        //Dados fake apenas para desenvolvimento
        $rootScope.foto = "data:image/jpeg;base64,";
        $state.go("app.postar");
    }
  }

        $scope.filters =[{name: 'Filtros', items: ['teste']  }];

    

  
  /*
   * if given group is the selected group, deselect it
   * else, select the given group
   */
  $scope.toggleFilter = function(filter) {
    if ($scope.isFilterShown(filter)) {
      $scope.shownFilter = null;
    } else {
      $scope.shownFilter = filter;
    }
  };
  $scope.isFilterShown = function(filter) {
    return $scope.shownFilter === filter;
  };

  $scope.logout = function(){
    var usuario = null;
    localStorage.setItem("usuario", usuario);
    $state.go("login");
  }



});
